import React from 'react';

const Navigation = () => (
    <ul>
        <li><a href="/">Twitter</a></li>
        <li><a href="/articles"></a>Articles</li>
        <li><a href="/notes"></a>Notes</li>
    </ul>
);

export default Navigation;
